function ProductDetail(){
    return(

        <section className="container mt-4">
            <div className="row">
                <div className="col-4">
                    <img src={logo} className="card-img-top" alt="..."/>
                </div>
                <div className="col-8">
                    <h3>Product Title</h3>
                    <p>Product Description</p>
                </div>
            </div>
        </section>
    )
}

export default ProductDetail;
